import React from "react";

export const WorkExperience = ()=>{

    const styles = {
        container: {
            padding: '150px',
            fontSize: '19px',
            lineHeight: '1.5',
            textAlign: 'center',
        },
        heading: {
            fontSize: '36px',
            marginBottom: '30px',
        },
    };
    return (
        <div style={styles.container}>
            <h2 style={styles.heading}>Work Experience</h2>
          <p>As a freelance developer, I have had the opportunity to work on a variety of projects using different technologies. Some of the projects I have worked on include:</p>
            <p>React-based Web Application: I developed a responsive web application using React, Redux, and Material-UI. The application allowed users to create, edit, and view articles and comments.</p>
            <p>Node.js RESTful API: I created a RESTful API using Node.js and Express that allowed users to interact with a database of products. The API was secured with JSON Web Tokens (JWT) and implemented pagination, filtering, and sorting.</p>
            <p></p>
            <p></p>
            <p></p>



        </div>
    );
}
